{{Kings of Balhae}}
'''Dae Mu-ye''', also known as '''King Mu''' ({{Ko-hhrm|hangul=무왕|hanja=武王}}) (r. 719–737), was the second king of the [[Balhae]]. He is noted for the military expansion of his domain.<ref>{{cite web |title=「渤海と古代の日本」 |url=http://www.nihonkaigaku.org/library/lecture/i110211-houkoku.pdf |website=2010 年度第 6 回日本海学講座 |publisher=酒寄 雅志}}</ref>
